import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import Navbar from "./Navbar";
import Footer from "./Footer";
import Home from "./Home";

function App() {
  return (
    <React.Fragment className="app-div">
      
        <Navbar />

        <Routes>
          <Route path="/">
            <Home />
          </Route>
        </Routes>

        <div>
          <Footer />
        </div>
      
    </React.Fragment>
  );
}

export default App;
